import './Landing-page.css';
import { useState } from 'react';

export function Landing() { 
    const UploadButton = () => {};
    const [AuthPin, setAuthPin] = useState('apple')
    const handleAuth = (v) => {
        if (v.length <= 5) {
            setAuthPin(v)
        }
    }

	return (
		<div class="center">
			<h1 className="font-link">Firefly</h1>
            <br></br>
            <form>

            </form>
            <button onClick={UploadButton} className="button-23">Upload a file</button>
            <br></br>
            <br></br>

            <input
                value={AuthPin}
                onChange={(e) => handleAuth(e.target.value)}
                className="space"
                type="text"
                id="pin"
            />
		</div>
	);
}
